var title_f14_49_15120="Automated DNA sequencing";
var content_f14_49_15120=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F77662&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F77662&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 505px\">",
"   <div class=\"ttl\">",
"    Automated DNA sequencing",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 485px; height: 195px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This representation of automated DNA sequencing shows how this technique can be used to detect mutations and other changes in DNA sequence. DNA is amplified in the presence of primers and chain terminators. Either the primers or the terminators are fluorescently labeled, with a different color fluorescence for each base. The automated sequencer uses a laser to excite the DNA containing these fluorescently labeled nucleotides and produces a color-coded intensity profile. In this example, guanine (G) is purple, adenine (A) is green, thymine (T) is red, and cytosine (C) is blue. The sequence can be read from the color of the peaks.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
