"       </a>",
"       ]",
"      </span>",
"     </div>",
"    </li>",
"    <li>",
"     <div class=\"reference\">",
"      Nguyen NN, Uy SS, and Song JC, \"Ramelteon: A Novel Melatonin Receptor Agonist for the Treatment of Insomnia,\"",
"      <i>",
"       Formulary",
"      </i>",
"      , 2005, 40:146-55.",
"     </div>",
"    </li>",
"   </ol>",
