"   <div class=\"block mop drugH1Div\" id=\"F172683\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Mental status for depression, suicidal ideation (especially at the beginning of therapy or when doses are increased or decreased), anxiety, social functioning, mania, panic attacks; signs/symptoms of serotonin syndrome; akathisia, sleep status; blood glucose (for diabetic patients), baseline liver function",
"    </p>",
"   </div>",
"   <div class=\"block rer drugH1Div\" id=\"F172687\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Reference Range",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Therapeutic levels have not been well established",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Therapeutic: Fluoxetine: 100-800 ng/mL (SI: 289-2314 nmol/L); Norfluoxetine: 100-600 ng/mL (SI: 289-1735 nmol/L)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Toxic: Fluoxetine plus norfluoxetine: &gt;2000 ng/mL",
"    </p>",
"   </div>",
