"   <div class=\"block pha drugH1Div\" id=\"F172673\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Inhibits CNS neuron serotonin reuptake; minimal or no effect on reuptake of norepinephrine or dopamine; does not significantly bind to alpha-adrenergic, histamine, or cholinergic receptors",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F172693\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Onset of action: Depression: The onset of action is within a week; however, individual response varies greatly and full response may not be seen until 8-12 weeks after initiation of treatment.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Well absorbed; delayed 1-2 hours with weekly formulation",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: V",
"     <sub>",
"      d",
"     </sub>",
"     : 12-43 L/kg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: 95% to albumin and alpha",
"     <sub>",
"      1",
"     </sub>",
"     glycoprotein",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hepatic, via CYP2C19 and 2D6, to norfluoxetine (activity equal to fluoxetine)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: Adults:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Parent drug: 1-3 days (acute), 4-6 days (chronic), 7.6 days (cirrhosis)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Metabolite (norfluoxetine): 9.3 days (range: 4-16 days), 12 days (cirrhosis)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak, serum: 6-8 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (10% as norfluoxetine, 2.5% to 5% as fluoxetine)",
"    </p>",
"    <p style=\"text-indent:0em;margin-top:2em;text-align:justify;\">",
"     <b>",
"      Note:",
"     </b>",
"     Weekly formulation results in greater fluctuations between peak and trough concentrations of fluoxetine and norfluoxetine compared to once-daily dosing (24% daily/164% weekly; 17% daily/43% weekly, respectively). Trough concentrations are 76% lower for fluoxetine and 47% lower for norfluoxetine than the concentrations maintained by 20 mg once-daily dosing. Steady-state fluoxetine concentrations are ~50% lower following the once-weekly regimen compared to 20 mg once daily. Average steady-state concentrations of once-daily dosing were highest in children ages 6 to &lt;13 (fluoxetine 171 ng/mL; norfluoxetine 195 ng/mL), followed by adolescents ages 13 to &lt;18 (fluoxetine 86 ng/mL; norfluoxetine 113 ng/mL); concentrations were considered to be within the ranges reported in adults (fluoxetine 91-302 ng/mL; norfluoxetine 72-258 ng/mL).",
"    </p>",
"   </div>",
